      :root {
        background-color: #161b2e;
        color: #fff;
        padding-right: 1px;
      }

      @media (min-width: 1024px) and (max-width: 1559px) {
        html {
          font-size: 1.026vw;
        }
      }

      * {
        box-sizing: border-box;
      }

      body {
        padding: 0;
        margin: 0;
      }

      .skeleton-wrapper {
        width: 100%;
        height: 100vh;
        height: 100svh;
      }

      .skeleton-inner {
        padding: 1.25rem;
        flex-grow: 1;
        display: flex;
        flex-direction: column;
      }

      .skeleton-wrapper:only-child {
        display: flex;
      }

      .skeleton-header {
        display: flex;
        align-items: center;
        height: 3.125rem;
        /*padding-left: 0.5rem;*/
        justify-content: space-between;
      }

      .skeleton-logo {
        width: 10rem;
        height: auto;
      }

      .skeleton-chat {
        width: 20rem;
        background-color: #1b2238;
        height: 100%;
      }

      .rings {
        display: block;
        -webkit-mask-image: url(data:image/svg+xml;base64,);
        -webkit-mask-size: contain;
        -webkit-mask-position: center;
        -webkit-mask-repeat: no-repeat;
        aspect-ratio: 1 / 1;
        background-color: currentColor;
        width: 1.5em;
      }

      .icon {
        aspect-ratio: 1 / 1;
        width: 100%;
        flex-shrink: 0;
        background-color: currentColor;
        -webkit-mask-size: contain;
        mask-size: contain;
        -webkit-mask-repeat: no-repeat;
        mask-repeat: no-repeat;
        -webkit-mask-position: center;
        mask-position: center;
      }

      .skeleton-chat {
        border-top-left-radius: 0.875rem;
      }

      /*.skeleton-header-loader {*/
      /*  width: calc(40rem / 16);*/
      /*  margin: calc(5rem / 16) 0;*/
      /*}*/

      .skeleton-content {
        max-width: min(calc(100vw - 20rem - 1.25rem * 2), 75rem);
        max-width: min(calc(100svw - 20rem - 1.25rem * 2), 75rem);
        margin-left: auto;
        margin-right: auto;
        margin-top: 1.25rem;
        position: relative;
        flex-grow: 1;
        width: 100%;
      }

      .skeleton-games {
        display: grid;
        grid-template-columns: repeat(7, minmax(0, 1fr));
        gap: 0.625rem;
      }

      .skeleton-main-loader {
        position: absolute;
        top: 50%;
        left: 50%;
        translate: -50% -50%;
        width: 5rem;
      }

      .skeleton-games div {
        height: 4.5rem;
        border-radius: 1rem;
        background-image: linear-gradient(90deg, #212842, #2c3555);
      }

      .skeleton-burger {
        padding: 0.75rem;
        display: none;
      }

      .skeleton-burger .icon {
        -webkit-mask-image: url(/svg/burger.svg);
        background-color: #dae2f5;
        width: 1rem;
      }

      @media (max-width: 1023px) {
        :root {
          padding-right: 0;
        }

        .skeleton-burger {
          display: block;
        }

        .skeleton-inner {
          padding: 0.625rem;
          padding-bottom: 0.875rem;
        }

        .skeleton-header {
          height: 2.5rem;
          margin-left: -0.125rem;
          margin-right: -0.125rem;
        }

        .skeleton-logo {
          width: 7.5rem;
        }

        .skeleton-chat {
          border-top-left-radius: 0;
        }

        .skeleton-header-loader {
          width: calc(34rem / 16);
        }

        .skeleton-chat {
          display: none;
        }

        .skeleton-games {
          display: none;
        }
      }
