    #alHUD{
    position: fixed !important;
    right:14px;
    bottom:14px;
    width:320px;
    max-width:92vw;
    z-index:2147483647;
    overflow: visible;
    background: transparent;
    color:#dff8ff;
    border-radius:12px;
    box-shadow:0 12px 40px rgba(0,0,0,.7);
    font-family:Inter, Roboto, system-ui,"Segoe UI",Arial;
    padding:8px 8px 2px 8px;
    user-select:none;
    height:430px;
    max-height:430px;
    }

    #alHUD > *{
    position: relative;
    z-index: 1;
    }
    #alHUD .hdr{display:flex;align-items:center;gap:8px;cursor:grab}
    #alHUD .title{flex:1;font-weight:900;color:#9be4ff;font-size:14px}
    #alHUD .miniBtn{width:34px;height:34px;display:flex;align-items:center;justify-content:center;border-radius:8px;background:rgba(255,255,255,0.02);cursor:pointer;color:#9be4ff}
    #alHUD .nickRow{display:flex;align-items:center;justify-content:space-between;gap:8px;margin-top:8px;margin-bottom:6px}
    #alHUD .nick{font-weight:800;color:#eaffff;white-space:nowrap;overflow:hidden;text-overflow:ellipsis;max-width:140px}
    #alHUD .jwtLine{font-size:12px;color:#9bd0e8}
    #alHUD .accountsSelect{position:relative}
    #alHUD .list{max-height:300px;overflow:auto;padding-right:6px;margin-top:6px}
    .lot-card{
    padding:14px 16px;
    border-radius:16px;
    margin-bottom:4px;
    background:linear-gradient(155deg,#0d1020,#171b35 40%,#391a4a 90%);
    border:1px solid rgba(255,80,200,0.15);
    box-shadow:0 0 20px rgba(255,80,200,0.12), inset 0 1px 0 rgba(255,255,255,0.04);
    backdrop-filter: blur(10px);
    transition:0.2s ease;
    }
    .lot-card:hover{ border-color:rgba(255,80,200,0.35); box-shadow:0 0 30px rgba(255,80,200,0.25); }
    .lot-top{display:flex;justify-content:space-between;align-items:center;gap:8px}
    .lot-name{font-weight:900;color:#bfefff}
    .lot-sub{font-size:12px;color:#9bd0e8}
    .lot-controls{display:flex;gap:6px;align-items:center;margin-top:8px;justify-content:flex-end}
    input[type="datetime-local"]{ padding: 8px 10px; border-radius: 10px; background: linear-gradient(140deg, #121426, #1a1e36 40%, #2c1a38 90%); border: 1px solid rgba(255,80,200,0.15); color: #ffffff; font-size: 13px; box-shadow: inset 0 1px 2px rgba(255,255,255,0.05), 0 0 10px rgba(255,80,200,0.10); transition: 0.2s ease; }
    input[type="datetime-local"]:focus{ border-color: rgba(255,80,200,0.35); box-shadow: 0 0 14px rgba(255,80,200,0.25), inset 0 1px 2px rgba(255,255,255,0.08); }
    .smallBtn{padding:6px 8px;border-radius:8px;border:0;background:rgba(255,255,255,0.03);color:#bfefff;cursor:pointer;font-weight:700;font-size:12px}
    .actBtn{background:linear-gradient(90deg,#ff6bd6,#6bd8ff);border:0;padding:8px 10px;border-radius:8px;color:#081018;font-weight:900;cursor:pointer;font-size:12px}
    #alHUD .footerRow{ display:flex; justify-content:space-between; align-items:center; margin-top:8px !important; gap:8px; }
    #alHUD .notify{ position:absolute; left:50%; top:65%; transform:translateX(-50%); background:rgba(8,20,30,0.98); color:#dff8ff; padding:10px 14px; border-radius:12px; box-shadow:0 8px 30px rgba(0,0,0,0.6); display:none; font-weight:700; font-size:14px; z-index:9999; }
    #alMiniIcon{position:fixed;display:none;z-index:2147483647;width:44px;height:44px;border-radius:8px;background:linear-gradient(90deg,#084c6b,#063a5a);color:#fff;align-items:center;justify-content:center;box-shadow:0 10px 30px rgba(0,0,0,0.6);cursor:pointer;font-weight:900}
    #alMiniIcon .miniTimer{font-size:11px;color:#dff8ff;margin-top:2px}
    @media (max-width:420px){
    #alHUD{right:8px;left:auto;bottom:8px;width:88vw;border-radius:10px;padding:6px}
    #alHUD .title{font-size:13px}
    input[type="datetime-local"]{font-size:12px}
    }

    #alHUD::before{
    content:"";
    position:absolute;
    inset:0;
    z-index:0;
    border-radius:12px;

    background: linear-gradient(180deg, rgba(15,15,20,0.88), rgba(10,10,15,0.88));

    pointer-events:none;
    }
